import React, { Component } from "react";

class FunkoCard extends Component {
  state = {
    clicked: false
  };

  render() {
    const { name, fandom, image_url } = this.props.funko;
    return (
      <div className="funko-card" onClick={this.props.selectFunko}>
        <img className="funko-img" src={image_url} alt={name} />

        <div className="funko-details">
          <h3>{name}</h3>
          <h4>{fandom}</h4>
        </div>
      </div>
    );
  }
}

export default FunkoCard;
